        /// <remarks>&lt;p&gt;Generates a report for service last accessed data for Organizations. You can generate a report for any entities (organization root, organizational unit, or account) or policies in your organization.&lt;/p&gt; &lt;p&gt;To call this operation, you must be signed in using your Organizations management account credentials. You can use your long-term IAM user or root user credentials, or temporary credentials from assuming an IAM role. SCPs must be enabled for your organization root. You must have the required IAM and Organizations permissions. For more information, see &lt;a href&#x3D;\&quot;https://docs.aws.amazon.com/IAM/latest/UserGuide/access_policies_access-advisor.html\&quot;&gt;Refining permissions using service last accessed data&lt;/a&gt; in the &lt;i&gt;IAM User Guide&lt;/i&gt;.&lt;/p&gt; &lt;p&gt;You can generate a service last accessed data report for entities by specifying only the entity&#39;s path. This data includes a list of services that are allowed by any service control policies (SCPs) that apply to the entity.&lt;/p&gt; &lt;p&gt;You can generate a service last accessed data report for a policy by specifying an entity&#39;s path and an optional Organizations policy ID. This data includes a list of services that are allowed by the specified SCP.&lt;/p&gt; &lt;p&gt;For each service in both report types, the data includes the most recent account activity that the policy allows to account principals in the entity or the entity&#39;s children. For important information about the data, reporting period, permissions required, troubleshooting, and supported Regions see &lt;a href&#x3D;\&quot;https://docs.aws.amazon.com/IAM/latest/UserGuide/access_policies_access-advisor.html\&quot;&gt;Reducing permissions using service last accessed data&lt;/a&gt; in the &lt;i&gt;IAM User Guide&lt;/i&gt;.&lt;/p&gt; &lt;important&gt; &lt;p&gt;The data includes all attempts to access Amazon Web Services, not just the successful ones. This includes all attempts that were made using the Amazon Web Services Management Console, the Amazon Web Services API through any of the SDKs, or any of the command line tools. An unexpected entry in the service last accessed data does not mean that an account has been compromised, because the request might have been denied. Refer to your CloudTrail logs as the authoritative source for information about all API calls and whether they were successful or denied access. For more information, see &lt;a href&#x3D;\&quot;https://docs.aws.amazon.com/IAM/latest/UserGuide/cloudtrail-integration.html\&quot;&gt;Logging IAM events with CloudTrail&lt;/a&gt; in the &lt;i&gt;IAM User Guide&lt;/i&gt;.&lt;/p&gt; &lt;/important&gt; &lt;p&gt;This operation returns a &lt;code&gt;JobId&lt;/code&gt;. Use this parameter in the &lt;code&gt; &lt;a&gt;GetOrganizationsAccessReport&lt;/a&gt; &lt;/code&gt; operation to check the status of the report generation. To check the status of this request, use the &lt;code&gt;JobId&lt;/code&gt; parameter in the &lt;code&gt; &lt;a&gt;GetOrganizationsAccessReport&lt;/a&gt; &lt;/code&gt; operation and test the &lt;code&gt;JobStatus&lt;/code&gt; response parameter. When the job is complete, you can retrieve the report.&lt;/p&gt; &lt;p&gt;To generate a service last accessed data report for entities, specify an entity path without specifying the optional Organizations policy ID. The type of entity that you specify determines the data returned in the report.&lt;/p&gt; &lt;ul&gt; &lt;li&gt; &lt;p&gt; &lt;b&gt;Root&lt;/b&gt; – When you specify the organizations root as the entity, the resulting report lists all of the services allowed by SCPs that are attached to your root. For each service, the report includes data for all accounts in your organization except the management account, because the management account is not limited by SCPs.&lt;/p&gt; &lt;/li&gt; &lt;li&gt; &lt;p&gt; &lt;b&gt;OU&lt;/b&gt; – When you specify an organizational unit (OU) as the entity, the resulting report lists all of the services allowed by SCPs that are attached to the OU and its parents. For each service, the report includes data for all accounts in the OU or its children. This data excludes the management account, because the management account is not limited by SCPs.&lt;/p&gt; &lt;/li&gt; &lt;li&gt; &lt;p&gt; &lt;b&gt;management account&lt;/b&gt; – When you specify the management account, the resulting report lists all Amazon Web Services services, because the management account is not limited by SCPs. For each service, the report includes data for only the management account.&lt;/p&gt; &lt;/li&gt; &lt;li&gt; &lt;p&gt; &lt;b&gt;Account&lt;/b&gt; – When you specify another account as the entity, the resulting report lists all of the services allowed by SCPs that are attached to the account and its parents. For each service, the report includes data for only the specified account.&lt;/p&gt; &lt;/li&gt; &lt;/ul&gt; &lt;p&gt;To generate a service last accessed data report for policies, specify an entity path and the optional Organizations policy ID. The type of entity that you specify determines the data returned for each service.&lt;/p&gt; &lt;ul&gt; &lt;li&gt; &lt;p&gt; &lt;b&gt;Root&lt;/b&gt; – When you specify the root entity and a policy ID, the resulting report lists all of the services that are allowed by the specified SCP. For each service, the report includes data for all accounts in your organization to which the SCP applies. This data excludes the management account, because the management account is not limited by SCPs. If the SCP is not attached to any entities in the organization, then the report will return a list of services with no data.&lt;/p&gt; &lt;/li&gt; &lt;li&gt; &lt;p&gt; &lt;b&gt;OU&lt;/b&gt; – When you specify an OU entity and a policy ID, the resulting report lists all of the services that are allowed by the specified SCP. For each service, the report includes data for all accounts in the OU or its children to which the SCP applies. This means that other accounts outside the OU that are affected by the SCP might not be included in the data. This data excludes the management account, because the management account is not limited by SCPs. If the SCP is not attached to the OU or one of its children, the report will return a list of services with no data.&lt;/p&gt; &lt;/li&gt; &lt;li&gt; &lt;p&gt; &lt;b&gt;management account&lt;/b&gt; – When you specify the management account, the resulting report lists all Amazon Web Services services, because the management account is not limited by SCPs. If you specify a policy ID in the CLI or API, the policy is ignored. For each service, the report includes data for only the management account.&lt;/p&gt; &lt;/li&gt; &lt;li&gt; &lt;p&gt; &lt;b&gt;Account&lt;/b&gt; – When you specify another account entity and a policy ID, the resulting report lists all of the services that are allowed by the specified SCP. For each service, the report includes data for only the specified account. This means that other accounts in the organization that are affected by the SCP might not be included in the data. If the SCP is not attached to the account, the report will return a list of services with no data.&lt;/p&gt; &lt;/li&gt; &lt;/ul&gt; &lt;note&gt; &lt;p&gt;Service last accessed data does not use other policy types when determining whether a principal could access a service. These other policy types include identity-based policies, resource-based policies, access control lists, IAM permissions boundaries, and STS assume role policies. It only applies SCP logic. For more about the evaluation of policy types, see &lt;a href&#x3D;\&quot;https://docs.aws.amazon.com/IAM/latest/UserGuide/reference_policies_evaluation-logic.html#policy-eval-basics\&quot;&gt;Evaluating policies&lt;/a&gt; in the &lt;i&gt;IAM User Guide&lt;/i&gt;.&lt;/p&gt; &lt;/note&gt; &lt;p&gt;For more information about service last accessed data, see &lt;a href&#x3D;\&quot;https://docs.aws.amazon.com/IAM/latest/UserGuide/access_policies_access-advisor.html\&quot;&gt;Reducing policy scope by viewing user activity&lt;/a&gt; in the &lt;i&gt;IAM User Guide&lt;/i&gt;.&lt;/p&gt;</remarks>
        /// <param name="entityPath">The path of the Organizations entity (root, OU, or account). You can build an entity path using the known structure of your organization. For example, assume that your account ID is &lt;code&gt;123456789012&lt;/code&gt; and its parent OU ID is &lt;code&gt;ou-rge0-awsabcde&lt;/code&gt;. The organization root ID is &lt;code&gt;r-f6g7h8i9j0example&lt;/code&gt; and your organization ID is &lt;code&gt;o-a1b2c3d4e5&lt;/code&gt;. Your entity path is &lt;code&gt;o-a1b2c3d4e5/r-f6g7h8i9j0example/ou-rge0-awsabcde/123456789012&lt;/code&gt;.</param>
