        /// </summary>
        /// <remarks>&lt;p&gt;Generates a report that includes details about when an IAM resource (user, group, role, or policy) was last used in an attempt to access Amazon Web Services services. Recent activity usually appears within four hours. IAM reports activity for at least the last 400 days, or less if your Region began supporting this feature within the last year. For more information, see &lt;a href&#x3D;\&quot;https://docs.aws.amazon.com/IAM/latest/UserGuide/access_policies_access-advisor.html#access-advisor_tracking-period\&quot;&gt;Regions where data is tracked&lt;/a&gt;.&lt;/p&gt; &lt;important&gt; &lt;p&gt;The service last accessed data includes all attempts to access an Amazon Web Services API, not just the successful ones. This includes all attempts that were made using the Amazon Web Services Management Console, the Amazon Web Services API through any of the SDKs, or any of the command line tools. An unexpected entry in the service last accessed data does not mean that your account has been compromised, because the request might have been denied. Refer to your CloudTrail logs as the authoritative source for information about all API calls and whether they were successful or denied access. For more information, see &lt;a href&#x3D;\&quot;https://docs.aws.amazon.com/IAM/latest/UserGuide/cloudtrail-integration.html\&quot;&gt;Logging IAM events with CloudTrail&lt;/a&gt; in the &lt;i&gt;IAM User Guide&lt;/i&gt;.&lt;/p&gt; &lt;/important&gt; &lt;p&gt;The &lt;code&gt;GenerateServiceLastAccessedDetails&lt;/code&gt; operation returns a &lt;code&gt;JobId&lt;/code&gt;. Use this parameter in the following operations to retrieve the following details from your report: &lt;/p&gt; &lt;ul&gt; &lt;li&gt; &lt;p&gt; &lt;a&gt;GetServiceLastAccessedDetails&lt;/a&gt; – Use this operation for users, groups, roles, or policies to list every Amazon Web Services service that the resource could access using permissions policies. For each service, the response includes information about the most recent access attempt.&lt;/p&gt; &lt;p&gt;The &lt;code&gt;JobId&lt;/code&gt; returned by &lt;code&gt;GenerateServiceLastAccessedDetail&lt;/code&gt; must be used by the same role within a session, or by the same user when used to call &lt;code&gt;GetServiceLastAccessedDetail&lt;/code&gt;.&lt;/p&gt; &lt;/li&gt; &lt;li&gt; &lt;p&gt; &lt;a&gt;GetServiceLastAccessedDetailsWithEntities&lt;/a&gt; – Use this operation for groups and policies to list information about the associated entities (users or roles) that attempted to access a specific Amazon Web Services service. &lt;/p&gt; &lt;/li&gt; &lt;/ul&gt; &lt;p&gt;To check the status of the &lt;code&gt;GenerateServiceLastAccessedDetails&lt;/code&gt; request, use the &lt;code&gt;JobId&lt;/code&gt; parameter in the same operations and test the &lt;code&gt;JobStatus&lt;/code&gt; response parameter.&lt;/p&gt; &lt;p&gt;For additional information about the permissions policies that allow an identity (user, group, or role) to access specific services, use the &lt;a&gt;ListPoliciesGrantingServiceAccess&lt;/a&gt; operation.&lt;/p&gt; &lt;note&gt; &lt;p&gt;Service last accessed data does not use other policy types when determining whether a resource could access a service. These other policy types include resource-based policies, access control lists, Organizations policies, IAM permissions boundaries, and STS assume role policies. It only applies permissions policy logic. For more about the evaluation of policy types, see &lt;a href&#x3D;\&quot;https://docs.aws.amazon.com/IAM/latest/UserGuide/reference_policies_evaluation-logic.html#policy-eval-basics\&quot;&gt;Evaluating policies&lt;/a&gt; in the &lt;i&gt;IAM User Guide&lt;/i&gt;.&lt;/p&gt; &lt;/note&gt; &lt;p&gt;For more information about service and action last accessed data, see &lt;a href&#x3D;\&quot;https://docs.aws.amazon.com/IAM/latest/UserGuide/access_policies_access-advisor.html\&quot;&gt;Reducing permissions using service last accessed data&lt;/a&gt; 